        </Navbar.Text>
        <Nav>
            <NavDropdown eventKey={1} title="Item 1">
                <MenuItem eventKey={1.1} href="#">Item 1.1</MenuItem>
            </NavDropdown>
            <NavItem eventKey={2}>Item 2</NavItem>
            <NavItem eventKey={3}>Item 3</NavItem>
        </Nav>
    </Navbar.Collapse>

</Navbar>
</div>
    );
  }
}

export default App;
